function structuriseDataFromTable(tableNodes, stagesNum, extraData = undefined) {
    let allPilots = [];
    Array.from(tableNodes).forEach((node,index) => {
        let pilot = [];
        let cells = Array.from(node.cells);

        if (cells[2].innerText === "SHAK") {
            cells[2].innerText = "Аджиашвили Шалва";
        }
        if (cells[2].innerText === "Godzilla Ваня") {
            cells[2].innerText = "Бавровский Иван";
        }
        if (cells[2].innerText === "Driftgal") {
            cells[2].innerText = "Шарабрина Екатерина";
        }


        let fullName = cells[2].innerText;
        let name = fullName.split(" ")[1] || "";
        let surname = fullName.split(" ")[0];
        let carNumber = cells[1].innerText;
        let carModel = "";
        let team = "";
        let totalSeasonPoints = parseInt(cells[cells.length-1].innerText);

        if (fullName === ("Алексей Шкуратов" || "Юра Перепечко" || "Александр Подвишенский" || "Антон Байдин")) {
            fullName = `${name} ${surname}`;
            name = fullName.split(" ")[1];
            surname = fullName.split(" ")[0];
        }
        
        if (extraData) {
            carModel = cells[3].innerText;
            team = cells[5].innerText;
        }

        pilot.push(fullName, carModel, carNumber, team, totalSeasonPoints);

        let stages = [];
        let tableShift = 3;
        for (let i = 1; i <= stagesNum; i++) {
            let qualificationBestScore = cells[tableShift + 1] ? cells[tableShift].innerText : "TBD";
            let stageTotalChampPoints = cells[tableShift + 1] ? cells[tableShift + 1].innerText : "TBD";
            let firstRun = extraData ? cells[6].innerText : null;
            let secondRun = extraData ? cells[7].innerText : null;

            if (stageTotalChampPoints === "X") {
                    stages.push("stageMissed");
                    tableShift += 2;
                    continue;
            }
            if (extraData) {
                firstRun = firstRun === null ? firstRun : parseFloat(firstRun.replace(",", "."));
                secondRun = firstRun === null ? secondRun : parseFloat(secondRun.replace(",", "."));
            }
            qualificationBestScore = qualificationBestScore === "TBD" ? qualificationBestScore : parseFloat(qualificationBestScore.replace(",", "."));
            stageTotalChampPoints = stageTotalChampPoints === "TBD" ? stageTotalChampPoints : parseFloat(stageTotalChampPoints.replace(",", "."));
            
            stages.push([firstRun, secondRun, qualificationBestScore, stageTotalChampPoints]);
            
            tableShift += 2;
        }
        pilot.push(stages);
        allPilots.push(pilot);
    });

    return allPilots.sort((a,b) => a[2].localeCompare(b[2]));
}


function addDataFromRdsTable(dataArr, year, series, stagesNum) {
    dataArr.forEach(person => {
//         let cells = Array.from(node.cells);

        let [fullName, carModel, carNumber, team, totalSeasonPoints, stages] = person;

        if (!driftData.names[fullName]) {
            addPerson(person, year, series);
//             addPerson(fullName, name, surname, carN, year, series, stages);
        }

        if (!driftData.names[fullName].years) {
            driftData.names[fullName].years = {};
        }

        if (!driftData.names[fullName].years[year]) {
            driftData.names[fullName].years[year] = {};
        }

        if (!driftData.names[fullName].years[year][series]) {
            fillYear(person, year, series);
        }
    });

    function addPerson([fullName, carModel, carNumber, team, totalSeasonPoints, stages], year, series) {
        let name = fullName.split(" ")[1] || "";
        let surname = fullName.split(" ")[0];

        driftData.names[fullName] = {};
        driftData.names[fullName].info = {
            firstname: name,
            surname: surname,
            midname: "",
            nickname: "",
            age: null,
            country: "",
            city: "",
            careerSince: null,
            carNumbers: [],
            currentTeam: "",
            photoURL: "",
            socials: {},
            cars: {},
            teams: {},
            series: {},

            careerStatistics: {
                achievements: {
                    championship : {
                        position: {
                            highest: null,
                            lowest: null,
                            average: null,
                            podiums: null,
                        },
                        points: {
                            highest: null,
                            lowest: null,
                            average: null,
                            totalEarned: null,
                        },
                    },
                    stage: {
                        race: {
                            points: {
                                highest: null,
                                lowest: null,
                                average: null,
                            },

                            position: {
                                highest: null,
                                lowest: null,
                                average: null,
                                podiums: null,
                            },   
                        },

                        qualification: {
                            score: {
                                highest: null,
                                lowest: null,
                                averageFirstScore: null,
                                averageSecondScore: null, 
                                averageBest: null,
                                averageBoth: null,
                            },
                            position: {
                                highest: null,
                                lowest: null,
                                average: null,
                            },
                        },
                    },
                },

                statistics: {
                    oneMoreTimes: null,
                    falseStarts: null,
                    technicalFailures: null,
                    crashTandemVictim: null,
                    crashesTotal: null,
                    hitWins: null,
                    hitLuckyWins: null,
                    fatalMistakes:  {
                        crashSelf: null,
                        crashTandemInitiator: null,
                        spinnedOut: null,
                        straightening: null,
                        dueMalfunction: null,
                    },
                    rivals: {
                        total: [],
                        wins: [],
                        losses: [],
                    },
                },
            },
        };
        if (fullName === "Аджиашвили Шалва") {
            driftData.names[fullName].info.nickname = "SHAK";
        }
        if (fullName === "Бавровский Иван") {
            driftData.names[fullName].info.nickname = "Godzilla Ваня";
        }
        if (fullName === "Шарабрина Екатерина") {
            driftData.names[fullName].info.nickname = "Driftgal";
        }

    }



    function fillYear([fullName, carModel, carNumber, team, totalSeasonPoints, stages], year, series) {
        let person = [fullName, carModel, carNumber, team, totalSeasonPoints, stages];
//         driftData.names[fullName].years[year] = {[series]: {}};
        driftData.names[fullName].years[year][series] = {
            info: {
                carsDriven: carModel,
                team: team,
                carNumber: carNumber,
                rivals: {
                    total: [],
                    wins: [],
                    losses: [],
                },
            },
            stages: {},
        }

        if (!driftData.names[fullName].info.cars[year]) {
            driftData.names[fullName].info.cars[year] = [];
        }

        if (!driftData.names[fullName].info.teams[year]) {
            driftData.names[fullName].info.teams[year] = [];
        }

        if (!driftData.names[fullName].info.series[series]) {
            driftData.names[fullName].info.series[series] = {};
        }
        
        driftData.names[fullName].info.series[series][year] = {
                position: null,
                stagesParticipated: null,
        };

        fillStages(person, year, series);

        let stagesComplete = 0;
        let allStages = Object.values(driftData.names[fullName].years[year][series].stages);
        allStages.forEach(stage => stage !== "stageMissed" ? stagesComplete++ : false);

        if (stagesComplete > 2) {
            driftData.names[fullName].years[year][series].seasonResults = {
                championship : {
                    totalPoints: totalSeasonPoints,
                    totalMinusOneWorstStagePoints: null,
                },

                achievements: {
                    stage: {
                        race: {
                            points: {
                                highest: null,
                                lowest: null,
                                average: null,
                            },

                            position: {
                                highest: null,
                                lowest: null,
                                average: null,
                                podiums: null,
                            },   
                        },

                        qualification: {
                            score: {
                                highest: null,
                                lowest: null,
                                averageFirstScore: null,
                                averageSecondScore: null, 
                                averageBest: null,
                                averageBoth: null,
                            },
                            position: {
                                highest: null,
                                lowest: null,
                                average: null,
                            },
                        },
                    },
                },

                statistics: {
                    oneMoreTimes: null,
                    falseStarts: null,
                    technicalFailures: null,
                    crashTandemVictim: null,
                    crashesTotal: null,
                    hitWins: null,
                    hitLuckyWins: null,
                    fatalMistakes:  {
                        crashSelf: null,
                        crashTandemInitiator: null,
                        spinnedOut: null,
                        straightening: null,
                        dueMalfunction: null,
                    },
                },
            }
        } else {
            driftData.names[fullName].years[year][series].seasonResults = "notEnoughStages";
        }
    };
    

    function fillStages([fullName, carModel, carNumber, team, totalSeasonPoints, stages], year, series) {
        
        for (let i = 0; i < stages.length; i++) {
            if (stages[i] === "stageMissed") {
                driftData.names[fullName].years[year][series].stages[i+1] = "stageMissed";
                continue;
            }
            
            let [firstRun = null, secondRun = null, qualificationBestScore = null, stageTotalChampPoints = null] = stages[i];
            
            let isQualificationFailed = stageTotalChampPoints < 2 ? true: false;
            
            let failedQualStatistic = {
                falseStarts: null,
                technicalFailure: null,
                totalStagesCrashes: null,
                fatalMistakes:  {
                    crashSelf: null,
                    spinnedOut: null,
                    straightening: null,
                    dueMalfunction: null,
                }
            };
            
            let successQualStatistics = {
                oneMoreTimes: null,
                    falseStarts: null,
                    technicalFailure: null,
                    crashTandemVictim: null,
                    crashesTotal: null,
                    hitWins: null,
                    hitLuckyWins: null,
                    fatalMistakes:  {
                        crashSelf: null,
                        crashTandemInitiator: null,
                        spinnedOut: null,
                        straightening: null,
                        dueMalfunction: null,
                    },
                };
            driftData.names[fullName].years[year][series].stages[i+1] = {
                qualification: {
                    first: firstRun,
                    second: secondRun,
                    best: qualificationBestScore,
                    position: null,
                    isFailed: isQualificationFailed,
                },
                race: {
//                     car: carModel,
                    position: stageTotalChampPoints === 1 ? 32 : null,
                    stageTotalChampPoints: stageTotalChampPoints,
                },

                statistics: isQualificationFailed === false ? successQualStatistics : failedQualStatistic,
            };
        }
    };
}